import React, { useState } from "react" ;
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import App from "./App.js";


function NavBar(){
return(

 <div class="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm">
  <Router>
  <h5 class="my-0 mr-md-auto font-weight-normal">AppTrack</h5>
  <nav class="my-2 my-md-0 mr-md-3">
    <Link class="p-2 text-dark" to="/" >Calendar</Link>
    <Link class="p-2 text-dark" to="/newapp">Enter Application</Link>
    <Link class="p-2 text-dark" to="/history">History</Link> 
    </nav> 
    <Switch>
          <Route path="/">
            <App />
          </Route>
          <Route path="/newapp">
            <Users />
          </Route>
          <Route path="/history">
            <Home />
          </Route>
        </Switch>


    </Router>

</div>);
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}




export default NavBar;
